import React from 'react';

function Sidebar() {
  return (
    <div className="sidebar fixed inset-y-0 left-0 w-64 flex flex-col">
  {/* Logo and nav */}
  <div className="px-8 py-4">
    <div className="text-white text-3xl font-bold">travel</div>
    <nav className="flex flex-col mt-10">
      <a href="#" className="py-2">
        Home
      </a>
      <a href="#" className="py-2">
        Shop
      </a>
    </nav>
  </div>
</div>

  );
}

export default Sidebar;
